import React, { useState, useEffect } from "react";
import { Container, Row, Table, Col, Card, Button } from "react-bootstrap";
import { useLocation } from "react-router-dom";


function useQuery() {
    return new URLSearchParams(useLocation().search);
}

export default function ShowUser() {



    const [users, setUsers] = useState(null);

    const [err, setError] = useState(false);

    useEffect(() => {
        fetchedUsers();
    }, []);

    async function fetchedUsers() {
        try {
            const response = await fetch(
                "http://localhost:8080/clients",
                {
                    method: "GET",
                    headers: {
                        'Accept': 'application/json',
                        "Content-Type": "application/json",
                    },
                    redirect: "follow",
                }
            );
            let fetchedUsers = await response.json();
            JSON.parse(JSON.stringify(fetchedUsers))
            setUsers(fetchedUsers)
            // setLoading(false);
            console.log("elo" + users);
        } catch (err) {
            console.log(err);
            setError(err);
        }
    }

    let query = useQuery();

    return (
        <Container fluid>
            <Row className=" mt-5 ">
                <Col>
                    <Card style={{ width: '18rem' }}>
                        <Card.Body>
                            <Card.Title>Dodaj użytkownika</Card.Title>
                            <Button href="/CreateUser" variant="primary">Wybierz</Button>
                        </Card.Body>
                    </Card>
                </Col>
            </Row>
            <Link to={{ pathname: `/apartment`, search: `?building-id=${unit.BuildingID}` }} >

                <Card className="border-0 shadow width-1-1 clickable">
                    <Card.Body className="p-0 lightGray overflow-hidden">
                        <Row className="d-block d-xxl-none">
                            <Image src={unit.Photos[0].URL} style={{ objectFit: "cover", height: "200px", width: "100%" }} />
                        </Row>
                        <Row className="">
                            <Col xs="auto" className="d-none d-xxl-block">
                                {/* Correct src for image: units[unitsIndex].imagePath */}
                                <Image src={unit.Photos[0].URL} style={{ objectFit: "cover", height: "max(230px, calc(100%))", width: "300px" }} />
                            </Col>
                            <Col className="ps-5 pe-5 ">
                                <Row className="d-flex align-self-center py-5">
                                    <h1 className=" fw-bold" >
                                        {unit.Name}
                                    </h1>
                                    <h4 className="">
                                        <span className="text-muted">{unit.Address}</span>
                                    </h4>
                                </Row>
                            </Col>
                        </Row>
                    </Card.Body>
                </Card>
            </Link>
            <Row className="d-flex align-items-center justify-content-start pt-5">
                <Table striped bordered hover>
                    <thead>
                        <tr>
                            <th>#</th>
                            <th>Imię</th>
                            <th>Nazwisko</th>
                            <th>Id dokumentu</th>
                            <th>Nr telefonu</th>
                            <th>Email</th>
                        </tr>
                    </thead>
                    <tbody>
                        {users && users.map((user, index) => {
                            return (
                                <tr>
                                    <td>{user.id}</td>
                                    <td>{user.name}</td>
                                    <td>{user.lastname}</td>
                                    <td>{user.idDocument}</td>
                                    <td>{user.phoneNumber}</td>
                                    <td>{user.email}</td>
                                </tr>
                            )
                        })}
                    </tbody>
                </Table>
            </Row>
        </Container>
    );
};
